import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class HomeUpload extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             percentage : 10
        }
    }
    

    render() {

        const {percentage} = this.state;
        
        return (
            
            <div className="app-card">
                <div className="app-card-content">
                    <div className="app-card-content-inner">
                         <div className="app-home-upload">
                             <div className="app-home-upload-icon">
                                 <i className="icon-upload" />
                                 <h2>Sending ...</h2>
                             </div>
                             <div className="app-total-files-uploaded">Uploading 3 files</div>

                            <div className="app-progress">
                                <span className="app-progress-bar" style={{width : `${percentage}%`}} />
                            </div> 

                             <div className="app-state-uploads">
                                <div className="app-state-uploads-left">2.3M/5M</div> 
                                <div className="app-state-uploads-right">456K/s</div> 
                             </div>

                             <div className="app-form-action">
                                 <button className="app-button" type="button">Cancel</button>
                             </div>
                         </div>
                    </div>
                </div>
            </div>
        )
    }   
}
